C.Ul=new L.y("Selected Chip",null,null,null,null,null,null,null,null)
C.Um=new L.y("A toggle to lock and minimize the menu on a large canvas is built in to the menu button. It enables users to hide the side menu or rail, in order to make more space available for the app content. You can hide the menu completely or make it a rail, also on desktop and web canvas sizes. Similar menu toggle control is also available for the optional sidebar, that can be in the end drawer or pinned to the screen on a large canvas.\n",null,null,null,null,null,null,null,null)
C.Up=new L.y("Show canvas size information",null,null,null,null,null,null,null,null)
C.Uu=new L.y("By default sidebar is a part of the scaffold body. Turn off this setting to have it outside the scaffold, like the side menu and rail. It then also has its own app bar when pinned to the side",null,null,null,null,null,null,null,null)
C.Ut=new L.y("Menu width",null,null,null,null,null,null,null,null)
C.Uv=new L.y("Tooltips are nice, but can get in the way when you know the app. Flexfold allows your app to turn off its tooltips. Why not give users this choice for all other tooltips in your app too?",null,null,null,null,null,null,null,null)
C.Uw=new L.y("Always use a bottom side border on the app bar",null,null,null,null,null,null,null,null)
C.Ux=new L.y("Sidebar title",null,null,null,null,null,null,null,null)
C.Uy=new L.y("Bottom bar opacity",null,null,null,null,null,null,null,null)
C.UA=new L.y("Use modal routes when appropriate",null,null,null,null,null,null,null,null)
C.UD=new L.y("Show menu footer widget",null,null,null,null,null,null,null,null)
C.UE=new L.y("FLAT BUTTON",null,null,null,null,null,null,null,null)
C.UG=new L.y("When the view switches to a rail or side menu, the tab view is an excellent choice and works really well for related views for the active destination. This page shows this when you use a larger canvas that switches to rail or menu view.\n\nIn this example the tab bar is not anchored to bottom part of the app bar, it is in the top part of the body. The side bar is also present on this screen so we can see how it works with a tab bar view as well. ",null,null,null,null,null,null,null,null)
C.UJ=new L.y("App bar opacity",null,null,null,null,null,null,null,null)
C.UK=new L.y("Show bottom navigation when menu is manually hidden",null,null,null,null,null,null,null,null)
C.UM=new L.y("The Material standard shows the sidebar as a part of the scaffold body. Turn off this setting to have it outside the Scaffold, like the side menu and rail is. In that case it has its own app bar when pinned to the side. This setting affects if a bottom bar, when used on a large canvas, covers the sidebar or not.",null,null,null,null,null,null,null,null)
C.UN=new L.y("\nThe sidebar can be used to hold less used content in an application. It could be a search filter, a list of picked or selected items, maybe even usage instructions and guides.\n\nWhen you define Flexfold destinations, you can define which destinations should have a sidebar, every destination does not have to have one. In this demo app only the Setup, Theme, Tabs and Slivers destinations have a sidebar, the other pages do not have one.\n",null,null,null,null,null,null,null,null)
C.UO=new L.y("Always show bottom navigation bar",null,null,null,null,null,null,null,null)
C.UP=new L.y("Show tooltips",null,null,null,null,null,null,null,null)
C.UR=new L.y("In addition to the indexes, the destination's named route is included as a return value in the class. The navigator source and index change direction are also included. You can use this information to determine how you want to navigate to the destination.\n\nThis demo shows how this destination information can be used to to build different page transitions depending on where you navigated from. From locked side menu there is no transition. From a rail or a drawer the FadeTrough transition from the Flutter Animations packages is used. The bottom navigation uses the shared axis transition. The purpose of this transition design is to use transitions that fit the most likely devices used for the navigation method.\n",null,null,null,null,null,null,null,null)
C.US=new L.y("List tile sub title",null,null,null,null,null,null,null,null)
C.UT=new L.y("Could not load asset image!",null,null,null,null,null,null,null,null)
C.UV=new L.y("This demo app has a mockup user profile as a leading widget, showing it can be a complex widget. It is up to the implementation to make one that works OK in all modes",null,null,null,null,null,null,null,null)
C.UY=new L.y("Dark theme",null,null,null,null,null,null,null,null)
C.UZ=new L.y("Break from bottom navigation bar to rail at",null,null,null,null,null,null,null,null)
C.V_=new L.y("ON by default, but you can turn it off",null,null,null,null,null,null,null,null)
C.V1=new L.y("Use iOS blur effect on none iOS bottom bars. Cupertino bottom navigation bar is always frosted glass blurred when transparent",null,null,null,null,null,null,null,null)
C.V4=new L.y("The breakpoints for when the navigation type changes can be adjusted, the defaults work well enough for most use cases.\n\nNavigation destination labels only appear as tooltips in rail mode in order to create a slim icon only rail, suitable for tablets and landscape mode on phones.\n\nA sidebar using an end drawer is also supported. It can also become a permanent fixture on a wide enough canvas. The sidebar entrance also animates when its breakpoint is exceeded. Its visibility as a permanent fixture can also be toggled. The widths of the rail, side menu and the tools menu can be individually adjusted. \n\nIn this demo you can play with the settings and observe Flexfold in action. The API for the Flexfold has more features in addition to those demonstrated here.\n\nYou will find the key settings on the Setup page, but there are more usage hints and setup gems on other pages in the this demo app as well.",null,null,null,null,null,null,null,null)
C.V6=new L.y("Rail width",null,null,null,null,null,null,null,null)
C.V8=new L.y("Switch list tile",null,null,null,null,null,null,null,null)
C.V7=new L.y("This demo uses the newer Flutter Material 2018 typography instead of the older current Flutter default one from 2014. This creates a slightly different look.\n\nThe FlexColorScheme API allows you to set visualDensity, fontFamily, platform and typography directly without having to use the standard ThemeData factory. For more involved theme customization you can also create the starting point theme data object by using FlexColorScheme().theme and apply additional theming to it with Flutter's standard methods.\n",null,null,null,null,null,null,null,null)
C.V9=new L.y("Use a border on the top side of the bottom navigation bar",null,null,null,null,null,null,null,null)
C.Va=new L.y("When the drawer is opened in bottom navigation mode, also include the bottom destinations in it. By default they are excluded and only shown when needed to not be stranded. Normal usage and recommendation is to keep this OFF, as it may be confusing, but it can also be convenient in some situations, if you like multiple ways to navigate",null,null,null,null,null,null,null,null)
C.Vh=new L.y("Theming is not a part of Flexfold, it is included as an extra feature in this demo application. The theming shown here is done with another package called FlexColorScheme. This page presents the kind of theming that is simplified by using it.\n\nFlexColorScheme uses Flutter's newer ColorScheme based themes. It is similar to the standard ThemeData.from in that a theme is created from a ColorScheme. It has two convenience factories, FlexColorScheme.light and FlexColorScheme.dark. FlexColorScheme also address some theme gaps in the standard Theme.from ColorScheme.\n\nFlexColorScheme supports using a white appbar theme in light mode and a primary colored one in dark mode. Dark mode also support an even darker mode called true black. Different levels of pre-defined branded surface colors, with primary color blended into surfaces to create color branded light and dark themes are also supported.\n\nIn addition to the default material design standard theme, which is also included in the Flutter's ColorScheme, FlexColorScheme comes comes with a few extra themes to get you started theming your app.\n",null,null,null,null,null,null,null,null)
C.Vi=new L.y("Use a gradient app bar to make it more dynamic. The gradient color is based on your app bar color. With API you can change direction, which is used in this demo on the menu and sidebar app bars",null,null,null,null,null,null,null,null)
C.yB=new L.y("Frosted glass blur effect",null,null,null,null,null,null,null,null)
C.Vj=new L.y("Full responsive layout of the content body in this app is not part of the Flexfold demo and has not been paid too much attention to, but it has been verified to work well enough from normal phone sizes to large web and desktop canvas sizes. The content presentation is however not always optimally designed for phones.",null,null,null,null,null,null,null,null)
C.Vk=new L.y("When you have destinations in a bottom navigation bar and additional destinations in a drawer, you may want the navigation to such additional destinations to be modal when you navigate to them and your canvas is phone sized that does not show all destinations in the rail or side menu.\n\nWith Flexfold you can use the source of the navigation to determine if you want push a full screen route on top of the Flexfold scaffold with only back option available or push a replacement named version of it only into the body part.\n\nFlexfold does not normally show bottom navigation bar destinations in the drawer during bottom bar navigation mode. However, if you navigate to a destination in bottom navigation mode that is not on the bottom navigation bar, then if you open the drawer again after this, you will find the bottom navigation bar destinations in the drawer.\n",null,null,null,null,null,null,null,null)
C.Vo=new L.y("Normal responsive behavior is to only show bottom navigation when the width is below its breakpoint. With this setting it is also shown when the rail/menu is hidden manually. It is on by default in this demo, API default is OFF.",null,null,null,null,null,null,null,null)
C.Vp=new L.y("Keep using the rail even when menu breakpoint is exceeded",null,null,null,null,null,null,null,null)
C.Vs=new L.y("Not Selected Chip",null,null,null,null,null,null,null,null)
C.Vu=new L.y("Keep the rail and menu in the drawer, even when the breakpoints to show them are exceeded",null,null,null,null,null,null,null,null)
C.Vv=new L.y("\nFlexfold destinations can also be configured to use FABs. FAB usage can be defined per destination.\n ",null,null,null,null,null,null,null,null)
C.Vx=new L.y("Only useful if content extends behind the app bar",null,null,null,null,null,null,null,null)
C.Vw=new L.y("This setting is only useful if the scaffold body content also scroll behind the app bar",null,null,null,null,null,null,null,null)
C.VC=new L.y("Keep bottom navigation bar hidden",null,null,null,null,null,null,null,null)
C.VD=new L.y("Top side border",null,null,null,null,null,null,null,null)
C.VE=new L.y("To assist with responsive app development, you can show current canvas size in the styled app bar. This is usually not a setting you want to enable for end users, but useful during development",null,null,null,null,null,null,null,null)
C.VF=new L.y("Show sidebar at",null,null,null,null,null,null,null,null)
C.VG=new L.y("Default value is 246 ms, that matches the hard coded Drawer animation time",null,null,null,null,null,null,null,null)
C.VH=new L.y("The Flexfold layout design is primarily intended for Flutter applications that target Desktop and Web, but it is also useful for resizable apps on tablets and Chrome books. Sure, it works great for switching between portrait and landscape mode on phones and tablets too, offering navigation flexibility on phones and tablets as well.\n\nThis feature demonstration application uses named routing. You do not have to use named routes, but it is recommended. Named routes are easy with Flexfold and they also provide URL based routes if you plan to release your Flutter app on the Web. 'The 'onChangeDestination' callback from the Flexfold package provides not just an index for the tapped destination, but a class with the values that you see in each page header in this demo.\n",null,null,null,null,null,null,null,null)
C.VI=new L.y("Just because we can and for fun, let us show all the beautiful Undraw SVG images used in this demo app in a grid and then randomly animate in a new one.\n\nEach image box that randomly display one of the images has its own random wait duration before it switches and also a random switch animation time.\n\nEach time the screen is built, each image box gets a random colored border and a less saturated version of it is calculated for dark mode. When you switch to dark mode, it still has the same color hue based on the light theme's random color.\n\nAnother feature is that every image is color themed dynamically to match the color of its border. This is done by changing a color text string in the SVG file image data.\n",null,null,null,null,null,null,null,null)
C.VJ=new L.y("Selected list tile title",null,null,null,null,null,null,null,null)
C.VK=new L.y("The sidebar can of course contain any kind of widget. This example share the same content on all pages that have a side sidebar, but of course you can show whatever you like, just make sure that it fits nicely in the available width.\n\nJust for fun, here are some themed faster switching random Undraw images.",null,null,null,null,null,null,null,null)
C.VL=new L.y("There is a Breakpoint class used to get suitable amount of columns for this demo. It can be used to create different grid layouts all the way up to 4k widths. This screen is a nice stress test on a large canvas. If you maximize this screen on a 4K screen and toggle the menu, the animation will cause all the SVG images on the screen to be rescaled and redrawn in every frame. It is a good stress test of Flutter and it actually works very well, much better than resizing windows in Flutter does. Window resizing and resulting redraws still need improvements in Flutter. This demo app could perhaps be better optimized too.\n\nThe Undraw images bundled with the app are used as demo content in the grid. Each image box that randomly display one of the images, has its own random wait duration before it switches, they also have a random switch animation time. Each image box gets a random colored border box, a less saturated version of the color is calculated for dark mode. Thsu when you switch to dark mode, it still has the same color hue based on the light theme's random color. If you toggle the theme using the side menu toggle, you can see the difference. A nice detail is that each image is also using the same color as the box color as the color theme in each actual image.\n\nThere are only 30 different images that are switched in randomly to each postion in the grid. This demo list stops at 500 items in the grid.  it's a nice looking Flutter stress test, especially on the web.\n\nWith this page you can also test and see how Slivers work when the sidebar is a part of Scaffold body or outside it. It has bigger visual impact when and if a bottom navigation bar is used on a large canvas layout. Here we can use the test toggle to always show the bottom navbar to see it in a large layout. The setting that shows the bottom navbar when the menu is manually hidden and sidebar remains pinned visible, is probably a more real use case.\n",null,null,null,null,null,null,null,null)
C.VP=new L.y("Transparent bottom navigation bar",null,null,null,null,null,null,null,null)
C.VR=new L.y("If the app bar is dark or white, a border will be drawn at its bottom side. With the API you can set this separately for the app bar on the menu and main body, as well as on the sidebar app bar",null,null,null,null,null,null,null,null)
C.VU=new L.y("Dark theme with primary colored app bar",null,null,null,null,null,null,null,null)
C.VV=new L.y("Break from rail to side menu at",null,null,null,null,null,null,null,null)
C.VW=new L.y("When enabled and combined with a transparent app bar, you can see content scroll behind it",null,null,null,null,null,null,null,null)
C.VY=new L.y("\nThis demo app does not expose any settings for the FABs, but the pages Setup and Theme have been configured to have and show Floating action buttons.\n\nWith the API the FAB position can also be defined for each navigation mode separately, so that the FAB shows up as expected on the bottom right in phone bottom navigation mode and on the top in tablet and desktop mode or wherever you want it to be in each mode.\n\nOn the todo list is to add some pre-configured FAB locations that will also place the FAB on the edge of the rail or menu.",null,null,null,null,null,null,null,null)
C.VZ=new L.y("Menu selection highlight height",null,null,null,null,null,null,null,null)
C.W0=new L.y("This demo has an extra theme switch as a trailing widget",null,null,null,null,null,null,null,null)
C.W2=new L.y("Material default is to use a primary colored app bar. Turn OFF to enable selection of any color for the custom theme. This setting has no effect on built in themes, only on the custom theme",null,null,null,null,null,null,null,null)
C.W3=new L.y("OUTLINE BUTTON",null,null,null,null,null,null,null,null)
C.W4=new L.y("This feature is required so you do not get stranded without a way back to bottom bar destinations in this navigation mode. Another and a better way to tackle this is to push the destinations that are only in the drawer in this navigation mode as new full screen modal routes on top of the entire Flexfold scaffold with only back option available. This is normal and often preferred way of navigating from such extra drawer destinations.\n\nThis example application has been made to do so, by default using the prefer push info returned by the FlexfoldSelectedDestination information for such destinations, which are Home, Help and About in this demo app.\n\nEven when using this capability, it is still potentially possible to get stranded. If you in rail or menu mode navigate to Home, Help or About the destination should preferably not be pushed as a full screen with only back option, preferably we should only get the destination content replaced into the body part of the app. This demo app works this way. However, in this mode if you then resize the canvas to enable bottom navigation mode, the Home, Help and About views in this app do not know that they should change to full screen view with a back button taking user back to last used bottom navigation destination. In this scenario navigation to the bottom destinations will still be possible as they are now automatically present in the drawer. ",null,null,null,null,null,null,null,null)
C.yC=new L.y("Trailing",null,null,null,null,null,null,null,null)
C.W7=new L.y("Light theme with primary colored app bar",null,null,null,null,null,null,null,null)
C.Wb=new L.y("Menu animation duration",null,null,null,null,null,null,null,null)
C.Wc=new L.y("Side border on drawers in dark mode",null,null,null,null,null,null,null,null)
C.Wd=new L.y("Company Ltd",null,null,null,null,null,null,null,null)
C.Wf=new L.y("The switch list tile is ON",null,null,null,null,null,null,null,null)
C.Wg=new L.y("Not a very common design but can look nice too. This setting overrides all other color selections, also true black and disables app bar color selection on custom theme",null,null,null,null,null,null,null,null)
C.Wh=new L.y("Normal app bars can be a bit dull. This demo shows how you can make them more interesting by introducing a gradient into them, together with an optional transparency that also increases gradually.\n\nThe reason for the gradient is just to make the app bar more dynamic and interesting. Whereas the gradient transparency is used to display content behind the app bar as content scrolls below it.\n\nA transparent gradient that is fully opaque at the start of the app bar and increases in transparency towards the end, ensures that the title is always legible and keeps the effect subtle. A gradient and transparent app bar is still a matter of opinion and you can turn them off, as well as the scrolling behind the app bar or don't use the optional styled app bar constructor at all.\n",null,null,null,null,null,null,null,null)
C.Wi=new L.y("Side borders on drawers in dark mode are ON by default. In true black mode they are really needed. With the API you can change their color. There is also an API to enable side borders for light mode. It is OFF by default as it is normally not needed",null,null,null,null,null,null,null,null)
