C.Wy=new L.y("Turn OFF for light theme",null,null,null,null,null,null,null,null)
C.WA=new L.y("Show menu leading widget",null,null,null,null,null,null,null,null)
C.WB=new L.y("Use iOS frosted glass blur effect on transparent app bars",null,null,null,null,null,null,null,null)
C.WC=new L.y("Flexfold is a smooth responsive scaffold package for Flutter. This application demonstrates its core features.\n\nThe Flexfold responsive navigation automatically changes from bottom bar, to rail and to side menu as the canvas size grows. The smooth part is that the switches from one mode to another, are animated.\n\nOn a large canvas you can change the side menu from being hidden, to a rail and to be visible as a locked side menu. You do this by clicking on the menu button, the menu button determines based on canvas size and defined breakpoints which modes it can use and only switches between them.\n",null,null,null,null,null,null,null,null)
C.WD=new L.y("With Flexfold it is easy to include a gradient transparent app bar, there is a styled app bar factory to help make app bars like the ones you see in this demo. When you combine the gradient transparent app bar with a white app bar theme, you get a Material themed app bar that resembles common iOS style app bars a bit. If you want to go full iOS style, then use the frosted glass blur style on a material app bar as well. \n\nThis page uses a vertical scroll view that stops just before the tab bar, so you will not see the scroll behind app bar effect on this particular page. It is however visible on all other pages in this demo.\n\nThe Setup page already contains these app bar settings. This page just explained in a bit more detail how the app bar  made with the styled factory can be useful. There is also a feature that show current canvas size in the app bar. You can use it to verify that your responsive layouts work as designed during development.\n",null,null,null,null,null,null,null,null)
